import React, { Component } from 'react';
import './App.css';
import HomeLayout from './components/homepage/HomeLayout';

class App extends Component {
  render() {
    return (
      <div className="App">
        <div id="scene">
          <div data-depth="0.2">My first Layer!</div>
          <div data-depth="0.6">My second Layer!</div>
      </div>
      </div>
    );
  }
}

export default App;
